import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the profile modal to be visible
    await page.waitForSelector('#profileModal', { state: 'visible' });

    // Click on the followers count
    await page.click('.stats span:contains("followers")');

    // Wait for the user list modal to appear
    await page.waitForSelector('#userListModal', { state: 'visible' });

    // Take a screenshot of the user list modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_user_list.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_user_list.png'));

    // Verify that the user list modal opened
    const isUserListModalVisible = await page.isVisible('#userListModal');

    return {
      success: isUserListModalVisible,
      action: isUserListModalVisible ? "Successfully opened user list modal" : "Failed to open user list modal",
      extractedData: { isUserListModalVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
